import React, { Component } from 'react';

class ElevenIteration extends Component {
    constructor(props) {
        super(props)
        this.state = {
            title: '11 итерация',
        }
        this.changeTitle = () => {
            this.setState({
                title: 'Changed',
            })
        }
    }
    componentDidMount() {
        console.log('Компонент готов к использованию: componentDidMount')
    }

    componentDidUpdate(prevProps, prevState, snapshot) {
        console.log('Компонент обновлён: componentWillUpdate');
    }

    componentWillUnmount() {
        console.log('Компонент удалён из рендера: componentWillUnmount');
    }

    render() {
        return (
            <h1 onDoubleClick={this.changeTitle}>{ this.state.title }</h1>
        )
    }
}

export default ElevenIteration
